import react from "react"

export default function ProductCard({
    src,
    title,
    price,
    wishlist
}) {
    console.log("card")
    return ( <
        div >
        <
        img src = {
            src
        }
        />

        <
        h1 > {
            title
        } <
        /h1> <
        h3 > {
            price
        } < /h3> <
        button > {
            wishlist
        } < /button> <
        /div>

    )
}
